import React from "react";
import "./Nav.css";

function Navbar() {
  return (
    <nav>
      <div>
        <a href="">
          {" "}
          <img src="logo1.png" alt="" />
          E-boudio
        </a>
      </div>
      <div>
        <a href="/lal">Livres a lire</a>
        <a href="/lae">Livres a Ecouter</a>
        <a href="/lae">Categories</a>
      </div>
      <div>
        <a href="">Se Connecter</a>
        <a href="">S'inscrire</a>
      </div>
    </nav>
  );
}

export default Navbar;
